import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import AppHeader from './components/header';
import AppLogin from './components/logingsignup.js';
import AppItinerary from './components/itinerary';

function App() {
  const [currentPage, setCurrentPage] = useState('login'); // 'login', 'itinerary', etc.

  return (
    <div className="App">
      {currentPage !== 'login' && (
        <header id="header">
          <AppHeader />
        </header>
      )}
      <main>
        {currentPage === 'login' && <AppLogin />}
        {currentPage === 'itinerary' && <AppItinerary />}
        {/* Add other page components as needed */}
      </main>
    </div>
  );
}

export default App;
